import React, { useState } from "react";
import { Button, styled } from "reakit";

const Container = styled.div`
  margin: 8px;
  border: 1px solid lightgrey;
  border-radius: 2px;
`;

const Quote = (props) => {
  return <Container>{props.title}</Container>;
};

export default Quote;
